import React from "react";
import { AppBar, Toolbar } from "@mui/material";

const Navbar = () => {
  return (
    <AppBar>
      <Toolbar>
        <p> InfoObjects</p>
        <p>All Users</p>
        <p>Add User</p>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
